        <AgreeDiv border>
          <InnerAgreeDiv>
            <AgreeSpace>
                {allCheck ? (
                  <CheckCircleIcon style={{ color: '#FFCB2A', fontSize: '40px' }} />
                ) : (
                  <CheckCircleOutlineIcon style={{ color: '#A1A1A1', fontSize: '40px' }} />
                )}
                <SpanLeftMargin>
                     
                </SpanLeftMargin>
            </AgreeSpace>
          </InnerAgreeDiv>
        </AgreeDiv>

        {/*   */}
        <AgreeDiv>
          <InnerAgreeDiv>
            <AgreeSpace>
              <img
                src={termsOfUseCheck ? '../svg/check-btn-on.svg' : '../svg/check-btn.svg'}
                onClick={termsOfUseCheckClicked}
                alt="check-btn"
              />
              <SpanLeftMargin>
                 ()
              </SpanLeftMargin>
            </AgreeSpace>
            <RotateImageDiv rotated={termsRotated}
                onClick={termsDetailClick}>
              <KeyboardArrowRightIcon style={{fontSize: '2rem', color: '#A1A1A1'}}/>
            </RotateImageDiv>
          </InnerAgreeDiv>
        </AgreeDiv>
        <DetailDiv isVisible={termsRotated}>
            <DetailFontsize>
                1()<br/>
                    ( )  (https://www.maumieum.co.kr) (  )    (  )           .<br/>
                PC,             .<br/>
                2()<br/>
                      (   )                ,      .<br/>
                              .<br/>
                      ,         .<br/>
                           .<br/>
                3 (     )<br/>
                        ,   (       ), , ,  ,       00   () . ,           .<br/>
                                             .<br/>
                      ,    ,   , , ,       ,    ,            .<br/>
                               7    . ,       30     .    "            .<br/>
                                       .            3             .<br/>
                              ,     ,           .<br/>
                4(   )<br/>
                     .<br/>
                1.         <br/>
                2.      <br/>
                3.    <br/>
            </DetailFontsize>
        </DetailDiv>

        {/*     */}
        <AgreeDiv>
          <InnerAgreeDiv>
            <AgreeSpace>
              <img
                src={personalCheck ? '../svg/check-btn-on.svg' : '../svg/check-btn.svg'}
                onClick={personalCheckClicked}
                alt="check-btn"
              />
              <SpanLeftMargin>
                   ()
              </SpanLeftMargin>
            </AgreeSpace>
            <RotateImageDiv rotated={personalRotated}
                onClick={personalDetailClick}>
              <KeyboardArrowRightIcon style={{fontSize: '2rem', color: '#A1A1A1'}}/>
            </RotateImageDiv>
          </InnerAgreeDiv>
        </AgreeDiv>
        <DetailDiv isVisible={personalRotated}>
        <DetailFontsize>
                1()<br/>
                    ( )  (https://www.maumieum.co.kr) (  )    (  )           .<br/>
                PC,             .<br/>
                2()<br/>
