                               7    . ,       30     .    "            .<br/>
                                       .            3             .<br/>
                              ,     ,           .<br/>
                4(   )<br/>
                     .<br/>
                1.         <br/>
                2.      <br/>
                3.    <br/>
            </DetailFontsize>
        </DetailDiv>

        {/*    */}
        <AgreeDiv>
          <InnerAgreeDiv>
            <AgreeSpace>
              <img
                src={gradingCheck ? '../svg/check-btn-on.svg' : '../svg/check-btn.svg'}
                onClick={gradingCheckClicked}
                alt="check-btn"
              />
              <SpanLeftMargin>
                  ()
              </SpanLeftMargin>
            </AgreeSpace>
            <RotateImageDiv rotated={gradingRotated}
                onClick={gradingDetailClick}>
              <KeyboardArrowRightIcon style={{fontSize: '2rem', color: '#A1A1A1'}}/>
            </RotateImageDiv>
          </InnerAgreeDiv>
        </AgreeDiv>
        <DetailDiv isVisible={gradingRotated}>
        <DetailFontsize>
                1()<br/>
                    ( )  (https://www.maumieum.co.kr) (  )    (  )           .<br/>
                PC,             .<br/>
                2()<br/>
                      (   )                ,      .<br/>
                              .<br/>
                      ,         .<br/>
                           .<br/>
                3 (     )<br/>
                        ,   (       ), , ,  ,       00   () . ,           .<br/>
                                             .<br/>
                      ,    ,   , , ,       ,    ,            .<br/>
                               7    . ,       30     .    "            .<br/>
                                       .            3             .<br/>
                              ,     ,           .<br/>
                4(   )<br/>
                     .<br/>
                1.         <br/>
                2.      <br/>
                3.    <br/>
            </DetailFontsize>
        </DetailDiv>

        {/*       */}
        <AgreeDiv>
          <InnerAgreeDiv>
            <AgreeSpace>
              <img
                src={examineeCheck ? '../svg/check-btn-on.svg' : '../svg/check-btn.svg'}
                onClick={examineeCheckClicked}
                alt="check-btn"
              />
              <SpanLeftMargin>
                       ()
              </SpanLeftMargin>
            </AgreeSpace>
            <RotateImageDiv rotated={examineeRotated}
                onClick={examineeDetailClick}>
              <KeyboardArrowRightIcon style={{fontSize: '2rem', color: '#A1A1A1'}}/>
            </RotateImageDiv>
          </InnerAgreeDiv>
        </AgreeDiv>
        <DetailDiv isVisible={examineeRotated}>
        <DetailFontsize>
                1()<br/>
                    ( )  (https://www.maumieum.co.kr) (  )    (  )           .<br/>
                PC,             .<br/>
                2()<br/>
